import './App.css';
import React, {useState} from 'react';

function App() {
  const [Nombre, setNombre] = useState('');
  const [Edad, setSueldo] = useState(0);
  const [Pais, setApellidos] = useState('');
  const [Cargo, setCargo] = useState('');
  const [Anios, setEdad] = useState(0);
  const [Cedula, setCedula] = useState(0);
  const mostrarDatos = ()=>{
    alert(Nombre);
  }
  return (
    <div className="App">
      <div className="datos">
        <label>Cedula: <input type="text"
        onChange={(event) => {
          setCedula(event.target.value);
        }}
        /></label><br />
        <label>Nombre: <input type="text"
        onChange={(event) => {
          setNombre(event.target.value);
        }}
        /></label><br />

        <label>Apellidos: <input type="text"
        onChange={(event) => {
          setApellidos(event.target.value);
        }}
        /></label><br />

        <label>Cargo: <input type="text"
        onChange={(event) => {
          setCargo(event.target.value);
        }}
        /></label><br />

        <label>Sueldo: <input type="text" 

        /></label><br />
        onChange={(event) => {
          setSueldo(event.target.value);
        }}
        <label>Edad: <input type="text" /></label><br />
        onChange={(event) => {
          setEdad(event.target.value);
        }}

        <button onClick={mostrarDatos}>Registrar</button>
      </div>
    </div>
  );
}

export default App;
